public static void main(Args args)
{
    MZKWarehouseLabelController warehouseLabelController;

    warehouseLabelController = new MZKWarehouseLabelController();

    //pass the caller args to the controller
    warehouseLabelController.parmArgs(args);
    warehouseLabelController.parmReportName(ssrsReportStr(MZKWarehouseLabelReport, Report));

    //execute the report
    warehouseLabelController.parmShowDialog(false);
    warehouseLabelController.startOperation();
}
